INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106001, "キャル", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, 7001, 7, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105901, "コッコロ", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, 7002, 7, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105801, "ペコリーヌ", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, 7003, 7, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105801, "ペコリーヌ", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, 10001, 10, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106001, "キャル", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, 10002, 10, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105901, "コッコロ", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, 10003, 10, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106401, "シェフィ", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, 10004, 10, 1, 2104010, 2, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, "2015/12/17 15:00:00", 0, 105801, "ペコリーヌ", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, 12001, 12, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106001, "キャル", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, 13001, 13, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105901, "コッコロ", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, 13002, 13, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106401, "シェフィ", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, 13003, 13, 1, 2104010, 2, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105801, "ペコリーヌ", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, 13004, 13, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105901, "コッコロ", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, 14001, 14, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106401, "シェフィ", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, 14002, 14, 1, 2104010, 2, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105801, "ペコリーヌ", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, 14003, 14, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106001, "キャル", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, 14004, 14, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, "2015/12/17 15:00:00", 0, 105901, "コッコロ", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, 15001, 15, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106401, "シェフィ", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, 16001, 16, 1, 2104010, 2, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105801, "ペコリーヌ", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, 16002, 16, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106001, "キャル", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, 16003, 16, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105901, "コッコロ", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, 16004, 16, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105901, "コッコロ", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, 17002, 17, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106001, "キャル", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, 17004, 25, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105901, "コッコロ", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, 17005, 25, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106401, "シェフィ", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, 17006, 25, 1, 2104010, 2, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105801, "ペコリーヌ", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, 17007, 25, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 190801, "カリン", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, 18001, 18, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 190801, "カリン", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0.0, 18002, 18, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, "2015/12/17 15:00:00", 0, 190801, "カリン", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0.0, 19001, 19, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 3);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, "2015/12/17 15:00:00", 0, 190801, "カリン", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0.0, 19002, 19, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 4);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, "2015/12/17 15:00:00", 0, 190801, "カリン", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, 20001, 20, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 5);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, "2015/12/17 15:00:00", 0, 190801, "カリン", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0.0, 20002, 20, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 6);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106001, "キャル", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, 21001, 21, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105901, "コッコロ", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, 21002, 21, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 106401, "シェフィ", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0.0, 21003, 21, 1, 2104010, 2, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "2015/12/17 15:00:00", 0, 105801, "ペコリーヌ", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, 21004, 21, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, "2015/12/17 15:00:00", 0, 190801, "カリン", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, 22001, 22, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, "2015/12/17 15:00:00", 0, 190801, "カリン", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, 22002, 22, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, "2015/12/17 15:00:00", 0, 190801, "カリン", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, 23001, 23, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 3);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, "2015/12/17 15:00:00", 0, 190801, "カリン", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, 23002, 23, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 4);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "2019/01/31 12:00:00", 10011, 109001, "エリコ（バレンタイン）", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 4.08, 24001, 24, 2, 0, 1, 8.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "2019/01/31 12:00:00", 10011, 109001, "エリコ（バレンタイン）", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 5.0, 24002, 24, 2, 0, 1, 8.0, "2030/12/17 14:59:59", 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "2019/01/31 12:00:00", 10011, 109001, "エリコ（バレンタイン）", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 10.11, 24003, 24, 2, 0, 1, 8.0, "2030/12/17 14:59:59", 3);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "2019/01/31 12:00:00", 10011, 109001, "エリコ（バレンタイン）", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4.0, 24004, 24, 2, 0, 1, 8.0, "2030/12/17 14:59:59", 4);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "2019/01/31 12:00:00", 10011, 109001, "エリコ（バレンタイン）", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 6.0, 24005, 24, 2, 0, 1, 8.0, "2030/12/17 14:59:59", 5);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "2019/01/31 12:00:00", 10011, 109002, "エリコ（バレンタイン）", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 24006, 24, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 6);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "2019/01/31 12:00:00", 10011, 109002, "エリコ（バレンタイン）", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 24007, 24, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 7);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "2019/01/31 12:00:00", 10011, 109002, "エリコ（バレンタイン）", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 24008, 24, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 8);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "2019/01/31 12:00:00", 10011, 109002, "エリコ（バレンタイン）", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 24009, 24, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 9);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "2019/01/31 12:00:00", 10011, 109002, "エリコ（バレンタイン）", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 24010, 24, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 10);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "2019/01/31 12:00:00", 10011, 109101, "シズル（バレンタイン）", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2.12, 24011, 24, 2, 0, 1, 8.0, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "2019/01/31 12:00:00", 10011, 109101, "シズル（バレンタイン）", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 4.19, 24012, 24, 2, 0, 5, 8.0, "2030/12/17 14:59:59", 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "2019/01/31 12:00:00", 10011, 109101, "シズル（バレンタイン）", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2.3, 24013, 24, 4, 0, 2, 8.0, "2030/12/17 14:59:59", 3);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "2019/01/31 12:00:00", 10011, 109102, "シズル（バレンタイン）", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 24014, 24, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 4);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "2019/01/31 12:00:00", 10011, 109101, "シズル（バレンタイン）", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5.23, 24015, 24, 2, 0, 5, 8.0, "2030/12/17 14:59:59", 5);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "2019/01/31 12:00:00", 10011, 109102, "シズル（バレンタイン）", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 24016, 24, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 6);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "2019/01/31 12:00:00", 10011, 109101, "シズル（バレンタイン）", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 5.01, 24017, 24, 2, 0, 1, 8.0, "2030/12/17 14:59:59", 7);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "2019/01/31 12:00:00", 10011, 109102, "シズル（バレンタイン）", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 24018, 24, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 8);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "2019/01/31 12:00:00", 10011, 109102, "シズル（バレンタイン）", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 24019, 24, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 9);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "2019/01/31 12:00:00", 10011, 109102, "シズル（バレンタイン）", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 24020, 24, 1, 0, 1, 0.0, "2030/12/17 14:59:59", 10);
